package main

import "fmt"

import "unicode"

func main() {
	resultPartOne := compute(data1, false, ' ')
	fmt.Printf("result part one= %+v\n", resultPartOne)
	// part two
	min := len(data1)
	result := ' '
	for r := rune('a'); r <= rune('z'); r++ {
		count := compute(data1, true, r)
		if count < min {
			min = count
			result = r
		}
	}
	fmt.Printf("result part two: %d elements for unit %s\n", min, string(result))
}

func compute(data string, filtered bool, exclude rune) int {
	last := rune(' ')
	result := " "
	for _, c := range data {
		if filtered && (exclude == unicode.ToLower(c)) {
			continue
		}
		if unicode.IsLower(last) && unicode.ToUpper(last) == c {
			result = result[:len(result)-1]
			last = rune(result[len(result)-1])
			continue
		}
		if unicode.IsUpper(last) && unicode.ToLower(last) == c {
			result = result[:len(result)-1]
			last = rune(result[len(result)-1])
			continue
		}
		result = result + string(c)
		last = c
	}
	return len(result) - 1
}

